  baseURL: "https://run.mocky.io/v3/9ddcc153-4ecb-4420-9c62-0e0a204e25b8",
});

function App() {
  const [quote, setQuote] = useState("");
  const getQuote = () =>{
    api.get('/').then(res => {
      console.log(res.data);
    setQuote(res.data);
    }).catch(err => {
      console.log(err);

    });
  };
  return (
    <><button onClick={getQuote}>Get Quote</button><p>{quote}</p></>

  );
}

export default App;
